import { Routes, Link } from "react-router-dom";
import styled from "@emotion/styled";

import "./App.css";
import { Keyboard } from "./keyboard";

export default function App() {
  return (
    <Routes path="/">
      <Container>
        <div>
          <SvgBox>
            <Keyboard />
          </SvgBox>
          <Title>최재열 멍청이</Title>
          <SubTitle>들어보고 구매하는 키보드 스토어</SubTitle>
        </div>
        {/* <>
        <Username placeholder="아이디를 입력해 주세요" />
        <Password placeholder="비밀번호를 입력해 주세요" />
      </> */}
        <Link to="/login">
          <Button>로그인</Button>
        </Link>
      </Container>
    </Routes>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  height: 100%;
`;

const SvgBox = styled.div`
  margin: auto;
  width: 200px;
`;

const Title = styled.div`
  font-weight: bold;
  font-size: 20px;
  text-align: center;
`;

const SubTitle = styled.div`
  margin-top: 12px;
  font-weight: bold;
  font-size: 12px;
  text-align: center;
`;

const Username = styled.input`
  margin: 30px auto 0 auto;
  padding: 0 15px;
  width: 250px;
  height: 40px;
  border: none;
  outline: none;
  border-radius: 15px;
`;

const Password = styled.input`
  margin: 8px auto 0 auto;
  padding: 0 15px;
  width: 250px;
  height: 40px;
  border: none;
  outline: none;
  border-radius: 15px;
`;

const Button = styled.button`
  margin: 20px auto;
  width: 250px;
  height: 50px;
  border: 1px solid white;
  border-radius: 25px;
  background-color: black;
  color: white;
  font-weight: bold;
  font-size: 14px;
  cursor: pointer;

  &:active {
    background-color: white;
    color: black;
  }
`;
